import math

def lucas_fibonacci_product(n):

    def lucas(n):
        if n == 0:
            return 2
        if n == 1:
            return 1
        (a, b) = (2, 1)
        for _ in range(2, n + 1):
            (a, b) = (b, a + b)
        return b

    def fib(n):
        phi = (1 + math.sqrt(5)) / 2
        return round(phi ** n / math.sqrt(5))
    lucas_number = lucas(200)
    fibonacci_number = fib(n)
    return lucas_number / fibonacci_number

